INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (204,'048','태평한 자리 자리에 임금과 신하가 함께 자리를 했으니 이보다 더 장한 모습이 어디 있겠습니까. 본래 지켜오던 질병에 모처럼 내려 후회하여 가정을 이루는 운수입니다. 몸과 마음이 서로 편안하니 일신에 화기가 나타나고 힘이 넘칩니다. 일신이 편화롭고 굳하게 될 것이며 동서양방에서 관인이 나를 도울 것입니다.','길성이 문에 비치니 복과 은혜가 스스로 따르게 될 것입니다. 가정에 있을 경사는 필시 쾌하에 있을 기쁨이니 모두가 가정이 화락한 듯입니다. 모든 일이 길하니 세상만사가 태평하고 즐겁기만 합니다. 이 보다 더 무엇을 바라겠습니까?','임금의 용안이 밝고 신하가 태평스러우니 임금의 은혜가 온 백성에게 미치는 것입니다. 띠맵의 공명을 얻어 성공할 것이며 이름이 사방으로 떨치게 될 것입니다. 재물도 있고 권리도 있으니 사람들이 많이 흠모하고 추앙하게 될 것입니다.','해와 달이 밝고 밝으니 기쁜 일이 즉진 하겠습니다. 의리를 중시 여기면 일이 잘 풀리고 날날이 발전하게 되며 재물이 구름처럼 쌓일 것입니다. 재물이 외부에 있으니 눈을 먼 곳으로 돌려야 재물을 얻겠습니다. 보이면 당장 다가가 얻도록 하십시오.','좋은 일에 마장이 놓였으니 밖으로 재물을 탐하여 구하려 들면 흑수고하겠습니다. 구름이 흩어지고 달이 나타났으니 아름다운 경관이 새롭게 비쳐 재수는 좋겠으나 혹 구설수가 있으니 대인관계를 소홀히 해서는 안됩니다.','봄이 구슬같이 밝은 이슬에 깃들였으니 백가지 털이 다투어 피어나겠습니다. 만약 후회가 아니라면 반드시 경사가 있을 것입니다. 편상시에 대비함이 옳겠습니다 재력이 목에 따르니 태평한 세월 속에 날로 번창하게 될 것입니다.','재물이 외방에 비치니 실행하여 재물을 얻음이 좋습니다. 조심해 보십시오. 목마른 용이 물을 얻은 것이니 조화가 무궁무진하여 못할 일이 없을 것입니다. 만약에 경사로운 일이 없더라도 결과이 따를 것이니 필시 좋은 운수입니다.','재물이 휘영하니 기쁨이 가정에 가득합니다. 재물이 있고 기쁨이 있으니 더 무엇을 바라겠습니까? 재물과 결실이 곳간에 가득 찼으니 모든 사람들이 추앙해 뵈이할 것입니까. 이름이 사방으로 떨치는데 어찌 만민이 추앙하여 우러르지 않겠습니까?','다른 사람의 도움을 받아 집안이 날로 흥영하고 발전하게 되는 좋은 운수입니다. 만약 관인을 만나면 복력이 즉진할 운수이니 사람 사귀기를 역심으로 해야겠습니다. 고기와 영이 물을 얻었으니 하늘 일마다 문란치 않고 활발 역리게 될 것입니다.','관인이 만방에 있으니 일을 바쁘게 활기차게 진행하는데서 만나게 되겠습니다. 우연히 왕서 힘을 도왔주는 데 어찌 성공을 거두지 않겠습니까. 관인이 반드시 나타나 도울 줄 것이니 일을 시작하고 면일에 큰 이익이 있겠으며 동서 양방도 운두 해 두기 바랍니다.','단비가 경송 내려주니 백가지 결실이 풍성이 들겠습니다. 신수가 대길하여 반드시 재물이 왕성하겠습니다. 재물이 산같이 쌓였으니 생계 걱정은 아니 하지 않을 것입니다. 그러나 이러한 공덕도 평소에 노력한 대가에서이니 마음 자세를 잘 지켜야 합니다.','가정에 운수가 왕성하여 반드시 경사가 있을 것입니다. 재물이 가득하며 한 때는 좋은 약을 얻게 될 것입니다. 그러나 사람을 잘못 사귀면 그로 인하여 불길함을 당하게 될 것이니 거래를 조심하고 인간관계를 유의해야 합니다.','가정의 경사는 식구를 더 늘리는 일입니다. 소목이 띠대로 이루어지니 기쁜 빛이 얼굴에 가득 찹습니다. 신수가 이와 같으니 이밖에 무엇을 또 바라겠습니까. 다만 편안하고 순조로울 때 태만하고 거만하기 쉬우니 이것만 주의한다면 미래가 아주 밝습니다.','2025-03-02 11:57:39.340911+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (417,'048','国王和他的仆人在一个宁静的地方在哪里？幸运的是，很遗憾最初保留的疾病。身心彼此舒适，因此枪支出现在肾脏和溢出上。日本人将得到安慰和坚定，官员将在东部和西部的房间帮助我。','吉尔松在门口，祝福和恩典将跟随自己。家里的坡度可能是一个愉快的乐趣，每个人似乎都有一个家庭。一切都很漫长，所以世界是和平与有趣的。您还想要什么？','工资是明亮的，仆人是和平的，所以国王的恩典在人民身上。它将通过获得Titi Map的共鸣来取得成功，名字将在任何地方都颤抖。有财富和权利，因此人们将是可爱和尊敬的。','太阳和月亮明亮而明亮，所以我会提高自己的喜悦。如果您专注于自己的忠诚度，那么事情将得到充分解决，一天将发展，财富将像云一样积累。财富在外面，所以我们将不得不转向您的眼睛才能获得财富。如果看到它，请立即获取。','有很多好事，因此，如果您试图垂涎和节省您的财富，我会做的。乌云散布着，月亮出现，因此美丽的风景是新反映的，但是很幸运，但是由于有吸盘，您不应忽略人际关系。','春天像珠子一样明亮，所以我会用一百头发吵架。如果您不后悔，您一定会倾向于。在阶段时做好准备是正确的，并且力量将跟随脖子，因此它将在时间的安心中蓬勃发展。','最好是经营财富，因为财富反映在外国方面。当心。渴的龙得到了水，因此和谐将是无尽的。即使没有轻微的工作，结果也会遵循。','财富饿了，所以欢乐充满了家。您还想要什么，因为有财富和喜悦？财富和水果充满了地方，因此每个人都会受到尊敬。人们怎么会因为这个名字到处颤抖而受到尊敬？','好运的是，家庭将在他人的帮助下感到兴奋和发展。如果您遇到官员，您将能够提高自己的力量。由于肉类和精神浇水，它们将被逆转和活跃。','由于该官员在曼邦，我将在忙碌而活泼的过程中见面。您如何不偶然地帮助国王？官员肯定会出现并提供帮助，因此开始工作并在当天赚取巨额利润。','随着丹比（Danbi）的下降，将会有丰富的水果。 Sinsu将是如此强大，以至于财富将充满活力。财富像山一样积累，因此您不必担心生活。但是，这一优点也以通常的价格，因此您必须保持思想态度。','幸运的是在家中蓬勃发展，所以一定有一个斜坡。它将充满财富，您将获得一次好的药。但是，如果您是一个错误的人，您将是不祥的，因此请谨慎交易和关心人际关系。','房屋的斜率是增加家庭。小树是由乐队组成的，因此高兴的光满脸。 Shinsu就是这样，那么您还想要什么？但是，当它舒适和光滑时，它可以忽略不计，很容易感到不舒服。','2025-03-02 11:57:39.340911+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (488,'048','王と彼の召使は平和な場所にどこにいますか？元々飼育されていた病気を後悔するのは運です。体と心は互いに快適であるため、銃器が腎臓とオーバーフローに現れます。日本人は慰められ、しっかりしており、当局者は東と西の部屋で私を助けてくれます。','ギルソンはドアにいます、そして、祝福と恵みは自分自身に従います。家の斜面はおそらく快適になる喜びであり、誰もが家族を持っているようです。すべてが長いので、世界は平和で楽しいです。これ以上は何が欲しいですか？','賃金は明るく、召使は平和であるため、王の恵みは人々にあります。 Titiマップの共鳴を取得することで成功し、名前はどこでも震えます。富と権利があるので、人々は愛らしいと尊敬されます。','太陽と月は明るく明るいので、喜びを改善します。忠誠心に焦点を当てると、物事はうまく解決され、日が発展し、富が雲のように蓄積されます。富は外にあるので、富を得るために目を後ろに向ける必要があります。あなたがそれを見たら、今すぐ入手してください。','たくさんの良いことがあるので、あなたがあなたの富を切望して外に救おうとするなら、私はそれをします。雲が散らばっているので、月が現れたので、美しい景色が新しく反映されていますが、幸運なことは良いことですが、吸盤があるので、対人関係を無視すべきではありません。','春はビーズのような明るい露ですので、100頭の毛で口論します。あなたがそれを後悔しないなら、あなたは確かに傾くでしょう。段階の時点で準備されるのは正しいことであり、力は首に続くので、時代の安らぎの中で繁栄します。','富は外国の側に反映されているため、富を走らせる方が良いです。気をつけて。のどが渇いたドラゴンは水を得るので、調和は無限になります。わずかな作業がなくても、結果に従います。','富は空腹なので、喜びは家でいっぱいです。富と喜びがあるので、あなたはさらに何が欲しいですか？富と果物は場所でいっぱいなので、誰もが尊敬されます。名前がいたるところに震えているので、どうしてそんなに尊敬されるのでしょうか？','家族が他の人の助けを借りて興奮し、発展するのは幸運です。あなたが職員に会った場合、あなたはあなたの力を向上させることができます。肉と精神は水に水をまくので、それらは逆転し、すべての空に活動します。','役人はマンバンにいるので、私は忙しくて活気のある手続きで会います。どうして偶然王を助けることに成功しませんか？役人は確かに現れて助けてくれるので、その日に働き始めて大きな利益を上げてください。','ダンビが倒れると、豊富な果物があります。 sinsuは非常に強いので、富は活発になります。富は山のように蓄積されているので、あなたは生きることを心配することはありません。ただし、このメリットも通常の価格であるため、心の態度を維持する必要があります。','ラッキーは家で活発であるので、斜面がなければなりません。それは富に満ちており、あなたは一度良い薬を手に入れるでしょう。ただし、間違った人を作ると不吉になるので、取引と関係のケアに注意してください。','家の斜面は家族を増やすことです。小さな木はバンドで構成されているので、嬉しい光は顔でいっぱいです。 shinsuはこんな感じなので、他に何が欲しいですか？ただし、快適で滑らかな場合は、無視でき、不快になりやすくなります。','2025-03-02 11:57:39.340911+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (346,'048','Where is the king and his servants in a peaceful place? It is a luck that regrets the disease that was originally kept. The body and mind are comfortable with each other, so firearms appear on the renal and overflow. The Japanese will be comforted and firm, and the official will help me in the East and West room.','Gilseong is on the door, and blessings and grace will follow themselves. The slope in the home is probably the joy of being in a pleasant, and everyone seems to have a family. Everything is long, so the world is peaceful and fun. What more do you want than this?','The wages are bright and the servants are peaceful, so the grace of the king is on the people. It will succeed by obtaining the resonance of the Titi Map and the name will be trembled everywhere. There are wealth and rights, so people will be adorable and revered.','The sun and the moon are bright and bright, so I will improve my joy. If you focus on your loyalty, things will be solved well, day will develop, and wealth will accumulate like a cloud. The riches are outside, so we will have to turn your eyes back to get riches. If you see it, get it right now.','There''s a lot of good things, so if you try to covet and save your riches outside, I''ll do it. The clouds are scattered and the moon appeared, so the beautiful scenery is newly reflected, but it is good to be lucky, but because there is a sucker, you should not neglect interpersonal relationships.','Spring is a bright dew like a bead, so I''ll quarrel with a hundred hairs. If you don''t regret it, you will surely be inclined. It is right to be prepared at the time of phases, and the power will follow the neck, so it will flourish in the peace of time.','It is better to run riches because the wealth is reflected in the foreign side. Be careful. The thirsty dragon gets the water, so the harmony will be endless. Even if there is no slight work, the result will be followed.','The riches are hungry, so joy is full of homes. What more do you want because there are wealth and joy? Wealth and fruit are full of places, so everyone will be revered. How can the people be so revered because the name is trembling everywhere?','It is a good luck where the family will be excited and developed with the help of others. If you meet the official, you will be able to improve your power. Since meat and spirit have watered water, they will be reversed and active every sky.','Since the official is in Manbang, I will meet in a busy and lively proceeding. How do you not succeed in helping the king by chance? The official will surely appear and help, so start to work and make a big profit on the day.','As Danbi is going down, there will be abundant fruits. Sinsu will be so strong that the wealth will be vigorous. The riches have accumulated like a mountain, so you won''t worry about living. However, this merit is also in the usual price, so you must keep your mind attitude.','Lucky is vigorous at home, so there must be a slope. It will be full of wealth and you will get a good medicine once. However, if you make a wrong person, you will be ominous, so be careful about transactions and care for relationships.','The slope of the home is to increase the family. The small tree is made up of the band, so the glad light is full of face. Shinsu is like this, so what else do you want? However, when it is comfortable and smooth, it is negligible and easy to be uncomfortable.','2025-03-02 11:57:39.340911+00','e');
